import React from "react";
import { HeaderBottomItems,DropdownMenuWrapper } from "./style";
import { NavLink } from "react-router-dom";
const HeaderBottomItem = props => {
    const  {item} = props;
    return(
        <HeaderBottomItems className="menu-item">
            <NavLink exact activeClassName="active-menu" className="item-link" to={item.name === 'trang chủ' ? '/' : `/${item.name}`}>  {item.name} </NavLink>
            <DropdownMenuWrapper >

            </DropdownMenuWrapper>
        </HeaderBottomItems>
    );
}
export default HeaderBottomItem;
